1994-09-07, Riverside Theater: NIN (Further Down the Spiral Tour) / Marilyn Manson / Hole (open)

Per wiki, Riverside Theater is a concert hall that has seats seats for 2,460 people.

9/7/94 marked the sixth and final night of the NIN/Manson/Hole Tour that had started on 8/29. For the rest of that tour, Jim Rose Circus opened.

Courtney thanks the other bands on the tour for teaching them, punk rock. 

&quot;Cause we didn't know shit about punk rock until we got on this tour. We're new school now.&quot;

Then they show them how it's done, launching into an extended purple rage of &quot;Violet.&quot;

&quot;...Might last a day yeah/ Mine is forever!&quot; 

Prior to Asking For It that night, Courtney complains. 

&quot;Gimme some goddamn light, I can't fuckin see... Oh, did someone turn off the fuses? Well, I'll just set fire to Nine Inch Nails' computers, and they won't be able to do anything.&quot;

And before you knew it was 

&quot;Bye bye Love / Bye my Love.&quot;

Actually, it was planned that way all along. 

Hole was not booted off the tour, only off of Trent's bed, apparently. 

Just so there was no love lost...


Hole is on a holy roll out the barrel of Milwaukee's finest shaking hell of a lotta Love. Enjoy with the most response, the girl with the most loaded cake.

